import React from 'react';
import './ErrorModel.css';
const ErrorModel = (props)=>{
    return (
            
        <div className='out'>
            <div className='oh'></div>
            <div className='check'>
                <header>
                    <span>{props.title}</span>
                </header>
                <div><p>{props.message}</p></div>
                <footer>    
                    <button onClick = {props.onError}>Okay</button>
                </footer>
            </div>
        </div>
    );
}
export default ErrorModel;
